import React, {
    Component
} from 'react';
import './listComponent_css.css'
class ListCards extends Component {
    state = {}

    render() {
        // .map((mosnter)=><h1 key={mosnter.id}>{mosnter.name}</h1>
        return ( <
            div className = 'listComponent' > {
                this.props.monsters.map((monster) => {
                    return <h1 > {
                        monster.name
                    } < /h1>
                })
            } <
            /div>
        );
    }
}

export default ListCards;
